const html = $input.first().json.data;


const match = html.match(/var ytInitialData = (.*?);\s*<\/script>/s);
if (!match) {
  return [{ json: { error: "ytInitialData not found" } }];
}

let data;
try {
  data = JSON.parse(match[1]);
} catch (err) {
  return [{ json: { error: "Invalid JSON", details: err.message } }];
}

let title = null;
let description = null;


try {
  const contents = data.contents.twoColumnWatchNextResults.results.results.contents;
  const videoPrimaryInfo = contents.find(c => c.videoPrimaryInfoRenderer);
  title = videoPrimaryInfo.videoPrimaryInfoRenderer.title.runs[0].text;
} catch (e) {
  title = null;
}


function findAttributedDescription(obj) {
  if (typeof obj !== 'object' || obj === null) return null;

  if (obj.attributedDescription && obj.attributedDescription.content) {
    return obj.attributedDescription.content;
  }

  for (const key in obj) {
    const result = findAttributedDescription(obj[key]);
    if (result) return result;
  }

  return null;
}

description = findAttributedDescription(data);

return [{
  json: {
    title,
    description
  }
}];

